import "./App.css";
import DataProvider from "./context/DataProvider";
import { BrowserRouter } from "react-router-dom";

//components
import Login from "./components/account/Login";
import Home from "./components/Home/Home";

function App() {
  return (
    <DataProvider>
      <BrowserRouter>

      <div>
        <Login />
        <Home />
      </div>
      </BrowserRouter>
    </DataProvider>

  );
}

export default App;
